    public partial class MainPage : ContentPage, INotifyPropertyChanged
    {
        private Dictionary<UInt64, JN_Chat> _chats = new();

        internal Dictionary<UInt64, JN_Chat> Chats
        {
            get => _chats;
            set
            {
                _chats = value;
                OnParentChanged();
            }
        }

        private Chat _actualChat = null;
        internal Chat ActualChat
        {
            get => _actualChat;
            set
            {
                if (_actualChat != value)
                {
                    _actualChat = value;
                    OnPropertyChanged(nameof(ActualChat));
                }
            }
        }


        private Accaunt _user = null;

        internal Accaunt User
        {
            get => _user;
            set
            {
                if (_user != value)
                {
                    _user = value;
                    OnPropertyChanged(nameof(User));
                }
            }
        }


        public event PropertyChangedEventHandler PropertyChanged;
        protected override void OnPropertyChanged([CallerMemberName] string propertyName = null)
        {
            PropertyChanged?.Invoke(this, new PropertyChangedEventArgs(propertyName));
        }

        public MainPage()
        {
            InitializeComponent();
            PageController.Init(User, Chats);

            BindingContext = this;


            // тесты

            User = new Accaunt(
                "frogges",
                "name",
                "nothing",
                12336,
                ImageSource.FromUri(new Uri("data:image/jpeg;base64,"))
                );



            PageController.AddChat(new Chat(
                new List<UInt64>() { 12, 13, 14 }, 
                ImageSource.FromUri(new Uri("data:image/jpeg;base64,")),
                "bibabobaba"
                ));

            OnParentChanged();

        }
        private void OnItemTapped(object sender, EventArgs e)
        {
            if (sender is Border border && border.GestureRecognizers[0] is TapGestureRecognizer tap)
            {
                if (tap.CommandParameter is Chat contact)
                {
                    ActualChat = contact;
                }
            }
        }
